import React, { useEffect, useState } from 'react'


const Icons = (props) => {


  const componentString  = `<${props.icon} />`
  const icon = React.createElement(React.Fragment, {}, componentString);
  
  return (
    <div>
      <div style={{"--color": props.color}} class="file-icons">{icon}</div>
    </div>
  )
}

export default Icons
